INSERT INTO `product` VALUES(300, 24, 'GAF-300 T001', '<p>\n	We offer a wide selection of quality <strong>table tops</strong> that suit&nbsp; all situations and budgets and can be used for indoor and outdoor use.\n</p>\n<p>\n	Our table tops are ideal for wide range venues and can be used as; dining&nbsp; room table tops and outdoor table tops, cafe table tops, hotel and restaurant&nbsp; table tops and many more.&nbsp;\n</p>\n<p>\n	We can create any table top to any size shape and style so if you have a&nbsp; request please contact our sales team for assistance.\n</p>', 438);
INSERT INTO `product` VALUES(302, 23, 'GAF-302 Faux Leather Quilt Top Round Ottoman', '<p>\n	The quilt top vinyl ottoman has squares sewn into the top, giving it a quilted pattern. This look adds a sophisticated appearance to this ottoman. This ottoman is completely padded with urethane foam for added comfort. The interior frame is built to last with sturdy construction consisting of medium density fiberboard and chipboard. The faux leather upholstery adds elegance to this ottoman and is sure to add charm to your living area.&nbsp;\n</p>\n<p>\n	Dimensions:  15" x 15"      Seat Height:  16"&nbsp;\n</p>\n<p>\n	Key Product Features:&nbsp;\n</p>\n<p>\n	Soft faux leather with quilted pattern decorate&nbsp;\n</p>\n<p>\n	Foam padded for complete comfort&nbsp;\n</p>\n<p>\n	Sturdy frame made of durable wood composite&nbsp;\n</p>\n<p>\n	Easy to clean, just wipe with damp cloth&nbsp;\n</p>\n<p>\n	Available in various colors\n</p>', 441);
INSERT INTO `product` VALUES(303, 23, 'GAF-303 Faux Leather Quilt Top Square Ottoman', 'The quilt top vinyl ottoman has squares sewn into the top, giving it a quilted pattern. This look adds a sophisticated appearance to this ottoman. This ottoman is completely padded with urethane foam for added comfort. The interior frame is built to last with sturdy construction consisting of medium density fiberboard and chipboard. The faux leather upholstery adds elegance to this ottoman and is sure to add charm to your living area.<br />\nDimension: H15 x L22 xW 22<br />\nKey Product Features:<br />\nSoft faux leather with quilted pattern decorate<br />\nFoam padded for complete comfort<br />\nSturdy frame made of durable wood composite<br />\nEasy to clean, just wipe with damp cloth<br />\nAvailable in various colors<br />\n<div>\n	<br />\n</div>', 444);
