INSERT INTO `product` VALUES(339, 25, 'GAF-339 Glass Side Table APT223', 'Eye catching and fun. This "candy drop" base table brings color and flair to any room it graces. This side table stands 21 inches tall and sports a 19 inch diameter glass top.<br />\n<br />\nDimensions: W19" X D19" X H21"<br />\n19" round table with "candy drop" base, a great accent to any room<br />\nPerfect for a cozy corner designed for drinks, snacks and coffee<br />\n21" Height<br />\nAvailable in various colors<br />', 490);
INSERT INTO `product` VALUES(340, 25, 'GAF-340 Stainless Steel Patio Table - Bar Height (Round 24)-ALT644B', 'This all-weather stainless steel table is perfect for use indoors or outdoors. The magnificent finish on the surface of the table top makes covering up the decorative design with a tablecloth almost seem like a crime. Absolutely reliable in a surprise situation where not enough table space is available.<br />\n<br />\nProduct Dimensions: 24 x 24 x 40 inches<br />\nWithstands all weather: hot, cold, rain or shine<br />\nEasy to clean, just wipe with damp cloth<br />\nLightweight sleek design<br />\nDimensions: Height: 40 inches; Table top: 24 inches by 24 inches<br />', 497);
INSERT INTO `product` VALUES(338, 25, 'GAF-338 24', 'The standard of all bistro round tables. With a single flared chrome base, guests can rest assure that whatever is on the table top won''t rock and tip over. The table top made from strong ABS plastic allows the table to come in a variety of different colors. The bar round table comes in various other colors to compliment any range of personal decor.<br />\n<br />\n24" round table with chrome color leg is a great accent or gathering point<br />\nAt 40.5" high, it is perfect for a cozy corner designed for drinks, snacks and coffee<br />\nA flared polished chrome stand means this table is a stable place for all items from vases to food items<br />\nAvailable in various colors: white, black, blue, red, brown, dark zebra<br />', 486);
INSERT INTO `product` VALUES(341, 25, 'GAF-341 Spyra Multi-Color LED Light Bar Table', 'Dimension: 15"W x 15"D x 43"H<br />\nAdds a colorful twist to your party, featuring etched swirls in the acrylic top that color-phase<br />\nMulti-colored LEDs hidden in the table phase between red, blue and green<br />\nTable is clear acrylic with visible etching when off<br />\nChrome base and pole<br />', 498);
INSERT INTO `product` VALUES(342, 1, 'GAF-342 Outdoor Folding Chair Set-MC112SET', 'This fun outdoor patio set includes 1 Table &amp; 2 Chairs. Great for home patio or backyard. Comfortable And Durable Frame makes it a perfect addition everyday use or when you have guest.<br />\n<br />\nTable Size: D24" X H28"<br />\nChair Size: W16"XD16"XH32" Seat Height: 18"<br />\nKey Product Features:<br />\nSet Includes 1 Table and 2 Chairs<br />\nFolding Table and Chairs for easy storing and space saving<br />\nLight Weight<br />\nEasy Cleaning<br />\nAlso Available in Black, White, and Orange.<br />', 499);
INSERT INTO `product` VALUES(343, 1, 'GAF-343 32', 'The standard of all bistro round tables. With a single flared chrome base, guests can rest assure that whatever is on the table top won''t rock and tip over. The table top made from strong ABS plastic allows the table to come in a variety of different colors.The bar round table comes in various other colors to compliment any range of personal decor.<br />\n<br />\nKey Product Features:<br />\n32" inches round table with chrome finished stand a great accent or gathering point<br />\nPerfect for a cozy corner designed for drinks, snacks and coffee<br />\nA flared polished chrome stand means this table is a stable place for all items from vases to food items<br />\nEasily release latch allows the table to fold and stack against the wall and each other with ease.<br />', 500);
INSERT INTO `product` VALUES(344, 1, 'GAF-344 Fold-able Side Table (24', 'The standard of all bistro round tables. With a single flared chrome base, guests can rest assure that whatever is on the table top won''t rock and tip over. The table top made from strong ABS plastic allows the table to come in a variety of different colors.<br />\nEasily release latch allows the table to fold and stack against the wall and each other with ease.<br />\nThe bar round table comes in various other colors to compliment any range of personal decor.<br />\nKey Product Features:<br />\n24"x24" table with chrome finished stand a great accent or gathering point<br />\nPerfect for a cozy corner designed for drinks, snacks and coffee<br />\nA flared polished chrome stand means this table is a stable place for all items from vases to food items<br />\nEasily release latch allows the table to fold and stack against the wall and each other with ease.<br />', 503);
INSERT INTO `product` VALUES(345, 1, 'GAF-345 Stainless Steel Table-ALT110', 'This all-weather stainless steel table is perfect for use indoors or outdoors. The magnificent finish on the surface of the table top makes covering up the decorative design with a tablecloth almost seem like a crime. Absolutely reliable in a surprise situation where not enough table space is available. Foldable table only avaiable in 24"x24" &amp; 24" Round. When folded, the table is thin enough to store against a wall or in the back of a closet without taking up an abundant amount of room. Withstands all weather: hot, cold, rain or shine Easy to clean, just wipe with damp cloth Fold-able table top for easy storage Heavy duty metal clasp to ensure the table top stays level.', 505);
INSERT INTO `product` VALUES(346, 20, 'GAF-346 Cast Iron Table Base TBC0522', 'Constructed for commercial businesses in mind, this table base will stand up to the test of time. Give all your tables the support it deserves. This sturdy base is 28 inches in height and safely accommodates table tops up to 48 inches in length. The metal feet have a base width of 21.25 inches. Extremely sturdy, durable and long lasting. Available in a black, brown or chrome finish. Great for commercial or home use. Quick and easy assembly. Recommend maximum of table top length: 48 inches per two base stands. Dimensions: Height: 28 inches; Base width: 21.25 inches; Column diameter: 3 inches.&nbsp;<br />\n<br />\nDimensions: L21.2" x W13" x H28"<br />\nRecommended maximum: 48 inches length table top (for two bases)<br />\nMade of heavy duty metal<br />\nPerfect for home or commercial use<br />\nDimensions: Height: 28 inches; Base width: 21.25 inches;<br />\nTABLE BASE ONLY - TABLETOP SOLD SEPARATELY and Assembling Required.&nbsp;<br />', 510);
